    return (
        <Flex align="center">
            <Box width={1 / 5}></Box>
            <Box width={1 / 2}>
                <h1>{intakeinfo.visitorcenter.title}</h1>
                {intakeinfo.visitorcenter.address.map(
                    k => {
                        return(
                            <p></p>
                        )
                    }
                )}
                <p>29816 Dobbin Huffsmith Road</p>
                <p>Magnolia, 77354</p>
